    "import torch\n",
    "from torchvision.transforms import ToTensor\n",
    "import time\n",
    "from LYTNet import LYTNet\n",
    "from LYTNetV2 import LYTNetV2\n",
    "import cv2\n",
    "import numpy as np\n",
    "from PIL import Image\n",
    "import matplotlib.pyplot as plt\n",
    "from torch.utils.data import DataLoader\n",
    "\n",
    "import warnings\n",
    "\n",
    "warnings.filterwarnings(\"ignore\")\n",
    "\n",
    "cuda_available = torch.cuda.is_available()\n",
    "\n",
    "MODEL_PATH = 'TrainingResult/TrainingResult-V2-200/_final_weights'\n",
    "\n",
    "net = LYTNetV2()\n",
    "checkpoint = torch.load(MODEL_PATH)\n",
    "net.load_state_dict(checkpoint)\n",
    "net.eval()\n",
    "\n",
    "trans = torchvision.transforms.ToTensor()\n",
    "    \n",
    "image = cv2.imread('PTL_Dataset_768x576/john_IMG_0720.jpg', cv2.IMREAD_COLOR)\n",
    "image = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)\n",
    "img = Image.fromarray(image)\n",
    "\n",
    "plt.imshow(img)\n",
    "\n",
    "img = trans(img).unsqueeze(0)\n",
    "img = img.type(torch.FloatTensor)\n",
    "img = img * 255\n",
    "\n",
    "print(img[0][0])\n",
    "\n",
    "with torch.no_grad():\n",
    "    if cuda_available:\n",
    "        img = img.cuda()\n",
    "    \n",
    "    pred_classes, pred_direc = net(img)\n",
    "    _, predicted = torch.max(pred_classes, 1)\n",
    "    print(predicted)"
